import "./style.css"

function About() {
	return (
        <div className="about">
            <article>
            <h3 className="heading-three">
                <span className="heading-num">02.</span>
                About me
            </h3>
            <p className="text-normal">
                I started as a content manager, after that I was the administrator of several online stores on CMS and constructors, at the moment I am a Front-end developer.
            </p>
            </article>
        </div>
	);
}

export default About;
